import React from 'react';
import Menu from './components/Menu';

export default function Sidebar() {
    return (
        <aside className="main-sidebar">
            <section className="sidebar position-relative">
                <div className="multinav">
                    <div className="multinav-scroll" style={{ height: '100%' }}>
                        <ul className="sidebar-menu" data-widget="tree">
                            <Menu
                                title="General Menu"
                                subTitle={{ name: 'Dashboard' }}
                                menu={[
                                    {
                                        name: 'Dashboard',
                                    },
                                    {
                                        name: 'Analytics',
                                    },
                                    {
                                        name: 'Report',
                                    },
                                ]}
                            />
                            <Menu
                                title="Cases"
                                subTitle={{ name: 'Create Case' }}
                                menu={[
                                    {
                                        name: 'Backlog Case',
                                    },
                                    {
                                        name: 'New Case',
                                    },
                                ]}
                            />
                            <Menu subTitle={{ name: 'Add Case Name/Number' }} />
                            <Menu subTitle={{ name: 'Add Case Defendant' }} />
                            <Menu subTitle={{ name: 'My Backlog cases' }} />
                            <Menu subTitle={{ name: 'New Case Activities' }} />
                            <Menu
                                subTitle={{ name: 'All Cases' }}
                                menu={[
                                    {
                                        name: 'All Cases',
                                    },
                                    {
                                        name: 'Ongoing Casesd',
                                    },
                                    {
                                        name: 'Awaiting Assignment',
                                    },
                                ]}
                            />
                        </ul>
                    </div>
                </div>
            </section>
            <div className="sidebar-footer">
                <a href="javascript:void(0)" className="link" data-bs-toggle="tooltip" title="Settings">
                    <span className="icon-Settings-2"></span>
                </a>
                <a href="mailbox.html" className="link" data-bs-toggle="tooltip" title="Email">
                    <span className="icon-Mail"></span>
                </a>
                <a href="javascript:void(0)" className="link" data-bs-toggle="tooltip" title="Logout">
                    <span className="icon-Lock-overturning">
                        <span className="path1"></span>
                        <span className="path2"></span>
                    </span>
                </a>
            </div>
        </aside>
    );
}
